import React from 'react';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function Home() {
  return (
    <div className='home'>
      <Container>
          <Box>
            <Box>
              <Typography variant='p'>Welcome To</Typography>
            </Box>
            <Box>
            <img src='https://img.freepik.com/free-photo/happy-family-with-shopping-bags_155003-6690.jpg?w=996&t=st=1706972055~exp=1706972655~hmac=1a49ebe07c095c738463624abfb05aa3b69fb435aad926442dfd8d6c4ea998be' alt='hero' height="540px" width="800px" />
            </Box>
          </Box>
      </Container>
    </div>
  )
}
